import { useState } from 'react'

function Square() {

    const [value, setValue] = useState(0)

    function handleClick() {
        setValue('X')
    }

    return (
        <>
            <button className="square" onClick={handleClick}>{value}</button>
        </>
    )
}

export default function Board() {
    return (
        <>
            <div className="board">
